BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Events" (
	"ID"	INTEGER NOT NULL,
	"Title"	TEXT NOT NULL,
	"Description"	TEXT NOT NULL,
	"Location"	TEXT NOT NULL,
	"Start"	TEXT NOT NULL,
	"OrganiserId"	INTEGER NOT NULL,
	CONSTRAINT "FK_Events_Users_OrganiserId" FOREIGN KEY("OrganiserId") REFERENCES "Users"("ID") ON DELETE CASCADE,
	CONSTRAINT "PK_Events" PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Foodshares" (
	"ID"	INTEGER NOT NULL,
	"Title"	TEXT NOT NULL,
	"Description"	TEXT NOT NULL,
	"PickupPlace"	TEXT NOT NULL,
	"PickupStart"	TEXT NOT NULL,
	"PickupEnd"	TEXT NOT NULL,
	"IsReserved"	INTEGER NOT NULL,
	"Photo"	TEXT,
	"SharedById"	INTEGER NOT NULL,
	"ReservedById"	INTEGER,
	CONSTRAINT "FK_Foodshares_Users_ReservedById" FOREIGN KEY("ReservedById") REFERENCES "Users"("ID") ON DELETE RESTRICT,
	CONSTRAINT "FK_Foodshares_Users_SharedById" FOREIGN KEY("SharedById") REFERENCES "Users"("ID") ON DELETE CASCADE,
	CONSTRAINT "PK_Foodshares" PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Users" (
	"ID"	INTEGER NOT NULL,
	"FirstName"	TEXT NOT NULL,
	"LastName"	TEXT NOT NULL,
	"Email"	TEXT NOT NULL,
	CONSTRAINT "PK_Users" PRIMARY KEY("ID" AUTOINCREMENT)
);
